			$string = "";
			if (!$no_opening_dashes) $string = "---\n";

			// Start at the base of the array and move through it.
			if ($array) {
				$array = (array)$array;
				$previous_key = -1;
				foreach ($array as $key => $value) {
					if (!isset($first_key)) $first_key = $key;
